import React from 'react'

class AllVideos extends React.Component {
  constructor(props){
    super(props)
  }
  render(){
  let videoList = this.props.videos.map((video)=>{return <li key={video}>{video.id}</li>})
  return (<div>
    <h3>Insert your video</h3>
    <p>All your videos:</p>
    <ul>{videoList}</ul>
  </div>)
  }
}
export default AllVideos
